import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const AllBookings = () => {
  const navigate = useNavigate();
  const [bookings, setBookings] = useState([]);
  const [filteredBookings, setFilteredBookings] = useState([]);
  const [activeFilter, setActiveFilter] = useState('All');
  const [loading, setLoading] = useState(true);
  const [selectedBooking, setSelectedBooking] = useState(null);
  const [showModal, setShowModal] = useState(false);

  // Fetch bookings from API
  useEffect(() => {
    fetchBookings();
  }, []);

  const fetchBookings = async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await fetch('http://localhost:5000/api/bookings', {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        }
      });

      if (response.ok) {
        const data = await response.json();
        // Transform data to match our component structure
        const transformedBookings = data.map(booking => ({
          id: booking._id,
          user: booking.user?.name || 'Unknown User',
          email: booking.user?.email || 'No email',
          car: booking.vehicle?.make || 'Unknown Make',
          model: booking.vehicle?.model || 'Unknown Model',
          pickupDate: new Date(booking.startDate).toLocaleDateString('en-US', {
            year: 'numeric',
            month: 'short',
            day: '2-digit'
          }),
          returnDate: new Date(booking.endDate).toLocaleDateString('en-US', {
            year: 'numeric',
            month: 'short',
            day: '2-digit'
          }),
          totalPrice: `₹${booking.totalPrice?.toLocaleString() || '0'}`,
          status: booking.status === 'confirmed' ? 'Confirmed' :
                  booking.status === 'cancelled' ? 'Cancelled' : 'Pending'
        }));

        setBookings(transformedBookings);
        setFilteredBookings(transformedBookings);
      } else {
        console.error('Failed to fetch bookings');
        // Fallback to sample data for demo
        const sampleBookings = [
          {
            id: 3,
            user: 'dj@123',
            email: 'dj@gmail.com',
            car: 'Ferrari',
            model: 'Roma',
            pickupDate: 'Apr 22, 2025',
            returnDate: 'Apr 24, 2025',
            totalPrice: '₹200,000',
            status: 'Pending'
          },
          {
            id: 2,
            user: 'tej@123',
            email: 'tej@gmail.com',
            car: 'Mercedes-Benz',
            model: 'S-Class',
            pickupDate: 'Apr 22, 2025',
            returnDate: 'Apr 24, 2025',
            totalPrice: '₹140,000',
            status: 'Pending'
          },
          {
            id: 1,
            user: 'Wsv@123',
            email: 'wsv@gmail.com',
            car: 'Toyota',
            model: 'Fortuner',
            pickupDate: 'May 01, 2023',
            returnDate: 'May 03, 2023',
            totalPrice: '₹400',
            status: 'Cancelled'
          }
        ];
        setBookings(sampleBookings);
        setFilteredBookings(sampleBookings);
      }
    } catch (error) {
      console.error('Error fetching bookings:', error);
      // Fallback to sample data
      const sampleBookings = [
        {
          id: 3,
          user: 'dj@123',
          email: 'dj@gmail.com',
          car: 'Ferrari',
          model: 'Roma',
          pickupDate: 'Apr 22, 2025',
          returnDate: 'Apr 24, 2025',
          totalPrice: '₹200,000',
          status: 'Pending'
        },
        {
          id: 2,
          user: 'tej@123',
          email: 'tej@gmail.com',
          car: 'Mercedes-Benz',
          model: 'S-Class',
          pickupDate: 'Apr 22, 2025',
          returnDate: 'Apr 24, 2025',
          totalPrice: '₹140,000',
          status: 'Pending'
        },
        {
          id: 1,
          user: 'Wsv@123',
          email: 'wsv@gmail.com',
          car: 'Toyota',
          model: 'Fortuner',
          pickupDate: 'May 01, 2023',
          returnDate: 'May 03, 2023',
          totalPrice: '₹400',
          status: 'Cancelled'
        }
      ];
      setBookings(sampleBookings);
      setFilteredBookings(sampleBookings);
    } finally {
      setLoading(false);
    }
  };

  const handleFilterChange = (filter) => {
    setActiveFilter(filter);
    if (filter === 'All') {
      setFilteredBookings(bookings);
    } else {
      setFilteredBookings(bookings.filter(booking => booking.status === filter));
    }
  };

  const handleStatusChange = async (bookingId, newStatus) => {
    try {
      const token = localStorage.getItem('token');
      const response = await fetch(`http://localhost:5000/api/bookings/${bookingId}/status`, {
        method: 'PUT',
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({
          status: newStatus.toLowerCase()
        })
      });

      if (response.ok) {
        // Update local state
        const updatedBookings = bookings.map(booking =>
          booking.id === bookingId ? { ...booking, status: newStatus } : booking
        );
        setBookings(updatedBookings);

        // Apply current filter to updated bookings
        if (activeFilter === 'All') {
          setFilteredBookings(updatedBookings);
        } else {
          setFilteredBookings(updatedBookings.filter(booking => booking.status === activeFilter));
        }
      } else {
        alert('Failed to update booking status');
      }
    } catch (error) {
      console.error('Error updating booking status:', error);
      alert('Error updating booking status');
    }
  };

  const getStatusBadgeClass = (status) => {
    switch (status) {
      case 'Pending': return 'bg-warning text-dark';
      case 'Confirmed': return 'bg-success';
      case 'Cancelled': return 'bg-danger';
      default: return 'bg-secondary';
    }
  };

  if (loading) {
    return (
      <div className="d-flex" style={{ minHeight: '100vh', background: '#f6f8fa' }}>
        {/* Sidebar */}
        <aside style={{ width: 260, background: '#25344e', color: '#fff', minHeight: '100vh' }} className="p-4">
          <h2 className="fw-bold mb-4" style={{ fontSize: '2rem' }}>Admin Panel</h2>
          <ul className="nav flex-column gap-3">
            <li className="nav-item">
              <button className="btn btn-link text-white text-start w-100" onClick={() => navigate('/admin')}>
                <i className="fas fa-home me-2"></i> Dashboard
              </button>
            </li>
            <li className="nav-item">
              <button className="btn btn-link text-white text-start w-100" onClick={() => navigate('/admin/cars')}>
                <i className="fas fa-car me-2"></i> Cars
              </button>
            </li>
            <li className="nav-item">
              <button className="btn btn-link text-white text-start w-100" onClick={() => navigate('/admin/users')}>
                <i className="fas fa-users me-2"></i> Users
              </button>
            </li>
            <li className="nav-item">
              <button className="btn btn-link text-white text-start w-100 active" onClick={() => navigate('/admin/bookings')}>
                <i className="fas fa-calendar-alt me-2"></i> Bookings
              </button>
            </li>
          </ul>
        </aside>

        {/* Main Content */}
        <main className="flex-grow-1 p-4">
          <div className="d-flex justify-content-center align-items-center" style={{ height: '50vh' }}>
            <div className="spinner-border text-primary" role="status">
              <span className="visually-hidden">Loading...</span>
            </div>
          </div>
        </main>
      </div>
    );
  }

  return (
    <div className="d-flex" style={{ minHeight: '100vh', background: '#f6f8fa' }}>
      {/* Sidebar */}
      <aside style={{ width: 260, background: '#25344e', color: '#fff', minHeight: '100vh' }} className="p-4">
        <h2 className="fw-bold mb-4" style={{ fontSize: '2rem' }}>Admin Panel</h2>
        <ul className="nav flex-column gap-3">
          <li className="nav-item">
            <button className="btn btn-link text-white text-start w-100" onClick={() => navigate('/admin')}>
              <i className="fas fa-home me-2"></i> Dashboard
            </button>
          </li>
          <li className="nav-item">
            <button className="btn btn-link text-white text-start w-100" onClick={() => navigate('/admin/cars')}>
              <i className="fas fa-car me-2"></i> Cars
            </button>
          </li>
          <li className="nav-item">
            <button className="btn btn-link text-white text-start w-100" onClick={() => navigate('/admin/users')}>
              <i className="fas fa-users me-2"></i> Users
            </button>
          </li>
          <li className="nav-item">
            <button className="btn btn-link text-white text-start w-100" style={{ backgroundColor: 'rgba(255,255,255,0.1)' }} onClick={() => navigate('/admin/bookings')}>
              <i className="fas fa-calendar-alt me-2"></i> Bookings
            </button>
          </li>
        </ul>
      </aside>

      {/* Main Content */}
      <main className="flex-grow-1 p-4">
        <div className="d-flex justify-content-between align-items-center mb-4">
          <h1 className="fw-bold">Manage Bookings</h1>
          <button className="btn btn-danger" onClick={() => { localStorage.removeItem('token'); navigate('/login'); }}>
            <i className="fas fa-sign-out-alt me-2"></i> Logout
          </button>
        </div>

        {/* Filter Buttons */}
        <div className="mb-4">
          {['All', 'Pending', 'Confirmed', 'Cancelled'].map(filter => (
            <button
              key={filter}
              className={`btn me-2 ${activeFilter === filter ?
                (filter === 'All' ? 'btn-primary' :
                 filter === 'Pending' ? 'btn-warning' :
                 filter === 'Confirmed' ? 'btn-success' : 'btn-danger') :
                'btn-outline-secondary'}`}
              onClick={() => handleFilterChange(filter)}
            >
              {filter}
            </button>
          ))}
        </div>

        {/* Bookings Table */}
        <div className="card shadow-sm">
          <div className="card-body">
            <div className="table-responsive">
              <table className="table table-hover align-middle mb-0">
                <thead className="table-light">
                  <tr>
                    <th>ID</th>
                    <th>User</th>
                    <th>Car</th>
                    <th>Pickup Date</th>
                    <th>Return Date</th>
                    <th>Total Price</th>
                    <th>Status</th>
                    <th>Actions</th>
                  </tr>
                </thead>
                <tbody>
                  {filteredBookings.length === 0 ? (
                    <tr>
                      <td colSpan="8" className="text-center py-4">
                        <i className="fas fa-inbox fa-3x text-muted mb-3"></i>
                        <p className="text-muted">No bookings found for the selected filter.</p>
                      </td>
                    </tr>
                  ) : (
                    filteredBookings.map((booking) => (
                      <tr key={booking.id}>
                        <td className="fw-bold">{booking.id}</td>
                        <td>
                          <div>
                            <div className="fw-semibold">{booking.user}</div>
                            <small className="text-muted">{booking.email}</small>
                          </div>
                        </td>
                        <td>
                          <div>
                            <div className="fw-semibold">{booking.car}</div>
                            <small className="text-muted">{booking.model}</small>
                          </div>
                        </td>
                        <td>{booking.pickupDate}</td>
                        <td>{booking.returnDate}</td>
                        <td className="fw-bold text-success">{booking.totalPrice}</td>
                        <td>
                          <select
                            className={`form-select form-select-sm badge ${getStatusBadgeClass(booking.status)}`}
                            value={booking.status}
                            onChange={(e) => handleStatusChange(booking.id, e.target.value)}
                            style={{ border: 'none', fontSize: '0.875rem' }}
                          >
                            <option value="Pending">Pending</option>
                            <option value="Confirmed">Confirmed</option>
                            <option value="Cancelled">Cancelled</option>
                          </select>
                        </td>
                        <td>
                          <button
                            className="btn btn-primary btn-sm"
                            title="View Details"
                            onClick={() => {
                              setSelectedBooking(booking);
                              setShowModal(true);
                            }}
                          >
                            <i className="fas fa-eye"></i>
                          </button>
                        </td>
                      </tr>
                    ))
                  )}
                </tbody>
              </table>
            </div>
          </div>
        </div>

        {/* Summary Stats */}
        <div className="row mt-4 g-3">
          <div className="col-md-3">
            <div className="card text-center">
              <div className="card-body">
                <h5 className="card-title text-primary">{bookings.length}</h5>
                <p className="card-text text-muted">Total Bookings</p>
              </div>
            </div>
          </div>
          <div className="col-md-3">
            <div className="card text-center">
              <div className="card-body">
                <h5 className="card-title text-warning">{bookings.filter(b => b.status === 'Pending').length}</h5>
                <p className="card-text text-muted">Pending</p>
              </div>
            </div>
          </div>
          <div className="col-md-3">
            <div className="card text-center">
              <div className="card-body">
                <h5 className="card-title text-success">{bookings.filter(b => b.status === 'Confirmed').length}</h5>
                <p className="card-text text-muted">Confirmed</p>
              </div>
            </div>
          </div>
          <div className="col-md-3">
            <div className="card text-center">
              <div className="card-body">
                <h5 className="card-title text-danger">{bookings.filter(b => b.status === 'Cancelled').length}</h5>
                <p className="card-text text-muted">Cancelled</p>
              </div>
            </div>
          </div>
        </div>

        {/* Booking Details Modal */}
        {showModal && selectedBooking && (
          <div className="modal fade show" style={{ display: 'block', backgroundColor: 'rgba(0,0,0,0.5)' }}>
            <div className="modal-dialog modal-lg">
              <div className="modal-content">
                <div className="modal-header">
                  <h5 className="modal-title">Booking Details - ID: {selectedBooking.id}</h5>
                  <button
                    type="button"
                    className="btn-close"
                    onClick={() => setShowModal(false)}
                  ></button>
                </div>
                <div className="modal-body">
                  <div className="row">
                    <div className="col-md-6">
                      <h6 className="fw-bold mb-3">Customer Information</h6>
                      <p><strong>Name:</strong> {selectedBooking.user}</p>
                      <p><strong>Email:</strong> {selectedBooking.email}</p>
                    </div>
                    <div className="col-md-6">
                      <h6 className="fw-bold mb-3">Vehicle Information</h6>
                      <p><strong>Make:</strong> {selectedBooking.car}</p>
                      <p><strong>Model:</strong> {selectedBooking.model}</p>
                    </div>
                  </div>
                  <hr />
                  <div className="row">
                    <div className="col-md-6">
                      <h6 className="fw-bold mb-3">Booking Details</h6>
                      <p><strong>Pickup Date:</strong> {selectedBooking.pickupDate}</p>
                      <p><strong>Return Date:</strong> {selectedBooking.returnDate}</p>
                      <p><strong>Total Price:</strong> <span className="text-success fw-bold">{selectedBooking.totalPrice}</span></p>
                    </div>
                    <div className="col-md-6">
                      <h6 className="fw-bold mb-3">Status</h6>
                      <span className={`badge ${getStatusBadgeClass(selectedBooking.status)} fs-6`}>
                        {selectedBooking.status}
                      </span>
                    </div>
                  </div>
                </div>
                <div className="modal-footer">
                  <button
                    type="button"
                    className="btn btn-secondary"
                    onClick={() => setShowModal(false)}
                  >
                    Close
                  </button>
                  <div className="btn-group">
                    <button
                      className="btn btn-warning"
                      onClick={() => {
                        handleStatusChange(selectedBooking.id, 'Pending');
                        setShowModal(false);
                      }}
                    >
                      Mark Pending
                    </button>
                    <button
                      className="btn btn-success"
                      onClick={() => {
                        handleStatusChange(selectedBooking.id, 'Confirmed');
                        setShowModal(false);
                      }}
                    >
                      Confirm
                    </button>
                    <button
                      className="btn btn-danger"
                      onClick={() => {
                        handleStatusChange(selectedBooking.id, 'Cancelled');
                        setShowModal(false);
                      }}
                    >
                      Cancel
                    </button>
                  </div>
                </div>
              </div>
            </div>
          </div>
        )}
      </main>
    </div>
  );
};

export default AllBookings;
